import React from 'react';
import products from '../products';

const DesignScreen = () => {
  return (
    <>
      <h2>Latest Designs</h2>
      <div className="row">
        {products.map((product) => (
          <div className="col sm={12} md={3}">
            <h3>{product.name}</h3>
          </div>
        ))}
      </div>
    </>
  );
};

export default DesignScreen;
